import React from 'react';
import './AppNovi.css';
import LargeButton from "./LargeButton";
import Header from "./Header";
import Footer from "./Footer";
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>


        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
